import React from "react";
import { Drawer } from "antd";
import "./ProjectDetail.css";

const ProjectDetail = ({ isVisible, setIsVisible, detail }) => {
  return (
    <Drawer
      title="Basic Drawer"
      placement="bottom"
      closable={true}
      height="90vh"
      onClose={() => setIsVisible(false)}
      visible={isVisible}
    >
      {detail}
    </Drawer>
  );
};

export default ProjectDetail;
